import * as React from "react";
import {
  Box,
  Avatar,
  Chip,
  Typography,
  List,
  ListItem,
  ListItemContent,
  ListItemDecorator,
  ListDivider,
  IconButton,
  Menu,
  MenuButton,
  MenuItem,
  Dropdown,
  Divider,
  CircularProgress,
  Button,
} from "@mui/joy";
import { ColorPaletteProp } from "@mui/joy/styles";

import MoreHorizRoundedIcon from "@mui/icons-material/MoreHorizRounded";
import CheckRoundedIcon from "@mui/icons-material/CheckRounded";
import BlockIcon from "@mui/icons-material/Block";
import AutorenewRoundedIcon from "@mui/icons-material/AutorenewRounded";
import KeyboardArrowRightIcon from "@mui/icons-material/KeyboardArrowRight";
import KeyboardArrowLeftIcon from "@mui/icons-material/KeyboardArrowLeft";

import { getTasks, TaskResponse } from "../../api/task";
import TaskFilters, { Filters } from "./TaskFilters";
import TaskTable from "./TaskTable";

function RowMenu({
  onEdit,
  onDelete,
}: {
  onEdit?: () => void;
  onDelete?: () => void;
}) {
  return (
    <Dropdown>
      <MenuButton
        slots={{ root: IconButton }}
        slotProps={{ root: { variant: "plain", color: "neutral", size: "sm" } }}
      >
        <MoreHorizRoundedIcon />
      </MenuButton>
      <Menu size="sm" sx={{ minWidth: 140 }}>
        <MenuItem onClick={onEdit}>Edit</MenuItem>
        <Divider />
        <MenuItem color="danger" onClick={onDelete}>
          Delete
        </MenuItem>
      </Menu>
    </Dropdown>
  );
}

export function toQueryParams(filters: Filters): Record<string, string> {
  const params: Record<string, string> = {};

  if (filters.status) {
    // Backend expects lowercase status values
    params.status = filters.status.toLowerCase();
  }
  if (filters.sort) {
    params.sort = filters.sort;
  }
  // Cache-busting parameter
  params._ = Date.now().toString();

  console.log("Query params:", params); // Debug: Log query parameters
  return params;
}

export default function TaskList() {
  const [tasks, setTasks] = React.useState<TaskResponse[]>([]);
  const [loading, setLoading] = React.useState(true);
  const [error, setError] = React.useState<string | null>(null);
  const [filters, setFilters] = React.useState<Filters>({ sort: "createdAt" });

  React.useEffect(() => {
    async function fetchData() {
      console.log("Fetching tasks with filters:", filters); // Debug: Log filters
      setLoading(true);
      setError(null);
      try {
        const params = toQueryParams(filters);
        const data = await getTasks(params);
        console.log("Fetched tasks:", data); // Debug: Log response
        // Normalize status to match TaskTable expectations (New, In_progress, Completed)
        const normalizedTasks = data.map((task: TaskResponse) => ({
          ...task,
          status:
            task.status.charAt(0).toUpperCase() +
            task.status.slice(1).toLowerCase(),
        }));
        console.log("Normalized tasks:", normalizedTasks); // Debug: Log normalized tasks
        setTasks([...normalizedTasks]); // Force new array reference
      } catch (error) {
        console.error("Error fetching tasks:", error);
        setError("Failed to load tasks. Please try again.");
      } finally {
        setLoading(false);
      }
    }

    fetchData();
  }, [filters]);

  // Debug: Log tasks state on every render
  console.log("Rendering with tasks:", tasks);

  const handleEdit = (id: string) => {
    console.log(`Edit task ${id}`); // Implement edit logic
  };

  const handleDelete = (id: string) => {
    console.log(`Delete task ${id}`); // Implement delete logic
  };

  return (
    <Box sx={{ display: "flex", flexDirection: "column" }}>
      {/* Filters always displayed above */}
      <Box sx={{ mb: 2, order: 1 }}>
        <Box sx={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
          <TaskFilters filters={filters} onFilterChange={setFilters} />
          <Button onClick={() => setFilters({})}>Reset Filters</Button>
        </Box>
      </Box>

      {/* Table and List area */}
      <Box sx={{ order: 2 }}>
        {/* Desktop Table */}
        <TaskTable
          rows={tasks}
          loading={loading}
          onEdit={handleEdit}
          onDelete={handleDelete}
        />

        {/* Mobile List */}
        <Box sx={{ display: { xs: "block", sm: "none" }, px: 2 }}>
          {loading ? (
            <Box sx={{ display: "flex", justifyContent: "center", mt: 4 }}>
              <CircularProgress />
            </Box>
          ) : error ? (
            <Typography color="danger">{error}</Typography>
          ) : tasks.length === 0 ? (
            <Typography level="body-md">No tasks found.</Typography>
          ) : (
            <>
              {tasks.map((task) => (
                <List key={task.id} size="sm" sx={{ "--ListItem-paddingX": 0 }}>
                  <ListItem
                    sx={{
                      display: "flex",
                      justifyContent: "space-between",
                      alignItems: "start",
                      mb: 2,
                    }}
                  >
                    <ListItemContent
                      sx={{ display: "flex", gap: 2, alignItems: "start" }}
                    >
                      <ListItemDecorator>
                        <Avatar size="sm">{task.title[0]}</Avatar>
                      </ListItemDecorator>
                      <div>
                        <Typography gutterBottom sx={{ fontWeight: 600 }}>
                          {task.title}
                        </Typography>
                        <Typography
                          level="body-xs"
                          gutterBottom
                          noWrap
                          sx={{ maxWidth: 240 }}
                        >
                          {task.description}
                        </Typography>
                        <Box
                          sx={{
                            display: "flex",
                            alignItems: "center",
                            gap: 0.5,
                            mb: 1,
                            flexWrap: "wrap",
                          }}
                        >
                          <Typography level="body-xs">
                            Created: {new Date(task.createdAt).toLocaleDateString()}
                          </Typography>
                          <Typography level="body-xs">â€¢</Typography>
                          <Typography level="body-xs">ID: {task.id}</Typography>
                        </Box>
                        <Typography level="body-xs">Until: {task.dueDate}</Typography>
                      </div>
                    </ListItemContent>
                    <Box
                      sx={{
                        display: "flex",
                        flexDirection: "column",
                        alignItems: "flex-end",
                        gap: 1,
                      }}
                    >
                      <Chip
                        variant="soft"
                        size="sm"
                        startDecorator={
                          {
                            New: <CheckRoundedIcon />,
                            In_progress: <AutorenewRoundedIcon />,
                            Completed: <BlockIcon />,
                          }[task.status]
                        }
                        color={
                          {
                            New: "success",
                            In_progress: "neutral",
                            Completed: "primary",
                          }[task.status] as ColorPaletteProp
                        }
                      >
                        {task.status}
                      </Chip>
                      <RowMenu onEdit={() => handleEdit(String(task.id))} onDelete={() => handleDelete(String(task.id))} />
                    </Box>
                  </ListItem>
                  <ListDivider />
                </List>
              ))}
              <Box
                className="Pagination-mobile"
                sx={{
                  display: { xs: "flex", md: "none" },
                  alignItems: "center",
                  py: 2,
                }}
              >
                <IconButton
                  aria-label="previous page"
                  variant="outlined"
                  color="neutral"
                  size="sm"
                >
                  <KeyboardArrowLeftIcon />
                </IconButton>
                <Typography level="body-sm" sx={{ mx: "auto" }}>
                  Page 1 of 1
                </Typography>
                <IconButton
                  aria-label="next page"
                  variant="outlined"
                  color="neutral"
                  size="sm"
                >
                  <KeyboardArrowRightIcon />
                </IconButton>
              </Box>
            </>
          )}
        </Box>
      </Box>
    </Box>
  );
}
